import React from "react";
import s from '../styles/dist/Filter.module.css'

const Filter = props => {
    console.log(props)

    return (
        <div className={s.wrapper}>
            <label><input type="checkbox" checked={props.filters.completed ? 'false' : 'false'} />Выполненные</label>
            <label><input type="checkbox" />Невыполненные</label>
        </div>
    )
};

export default Filter;
